/*Table structure for table `kegg_drug` */

DROP TABLE IF EXISTS `kegg_drug`;

CREATE TABLE `kegg_drug` (
  `kegg_id` varchar(200) NOT NULL,
  `kegg_url` varchar(200) DEFAULT NULL,
  `Formula` varchar(200) DEFAULT NULL,
  `imgPath` varchar(200) DEFAULT NULL,
  `pic_kegg_structure` varchar(200) DEFAULT NULL,
  `Target_href` varchar(200) DEFAULT NULL,
  `Target_id` varchar(200) DEFAULT NULL,
  `Pathway_href` varchar(200) DEFAULT NULL,
  `Pathway_name` varchar(200) DEFAULT NULL,
  `img_pathway_path` varchar(200) DEFAULT NULL,
  `pic_kegg_pathway` varchar(200) DEFAULT NULL,
  `Structure_map_href` varchar(200) DEFAULT NULL,
  `Structure_map_name` varchar(200) DEFAULT NULL,
  `Structure_map_title` varchar(200) DEFAULT NULL,
  `img_Structure_path` varchar(200) DEFAULT NULL,
  `pic_kegg_structure_map` varchar(200) DEFAULT NULL,
  PRIMARY KEY (`kegg_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

