ing on more labels are shown first): flatulence, flatus, flatu- lence, flat ulence, f latulence'),('http://sideeffects.embl.de/se/C0016382/','Flushing',': A transient reddening of the face that may be due to fever, certain drugs, exertion, stress, or a disease process.','(terms occurring on more labels are shown first): flushing, flushes, facial flushing, flush, facial flush, skin flush, flushing face, flushed skin, Flushed, flushing of face, flushed face'),('http://sideeffects.embl.de/se/C0016412/','Folate deficiency',': A nutritional condition produced by a deficiency of FOLIC ACID in the diet. Many plant and animal tissues contain folic acid, abundant in green leafy vegetables, yeast, liver, and mushrooms but destroyed by long-term cooking. Alcohol interferes with its intermediate metabolism and absorption. Folic acid deficiency may develop in long-term anticonvulsant therapy or with use of oral contraceptives. This deficiency causes anemia, macrocytic anemia, and megaloblastic anemia. It is indistinguishable from vitamin B 12 deficiency in peripheral blood and bone marrow findings, but the neurologic lesions seen in B 12 deficiency do not occur. (Merck Manual, 16th ed)','(terms occurring on more labels are shown first): folate deficiency, deficiency of folic acid, folic acid deficiency'),('http://sideeffects.embl.de/se/C0016436/','Folliculitis',': Inflammation of the hair follicles. Causes include excessive perspiration, skin infections, and skin wounds.','(terms occurring on more labels are shown first): folliculitis, folli- culitis'),('http://sideeffects.embl.de/se/C0016658/','Fracture',': A finding of traumatic injury to the bone in which the continuity of the bone is broken.','(terms occurring on more labels are shown first): fractures, fracture, bone fracture, bone fractures, fracture bone, fractured'),('http://sideeffects.embl.de/se/C0017086/','Gangrene',': Death of tissue, usually in considerable mass and generally associated with loss of vascular (nutritive) supply and followed by bacterial invasion and putrefaction.','(terms occurring on more labels are shown first): gangrene'),('http://sideeffects.embl.de/se/C0017152/','Gastritis',': Inflammation of the GASTRIC MUCOSA, a lesion observed in a number of unrelated disorders.','(terms occurring on more labels are shown first): gastritis, gastric inflammation'),('http://sideeffects.embl.de/se/C0017160/','Gastroenteritis',': Inflammation of the lining of the stomach and the intestines. Symptoms may include nausea, vomiting, diarrhea, and abdominal cramps (dull or sharp pains). Gastroenteritis may be caused by infection with bacteria, parasites, or viruses. It may also be caused by food poisoning, allergic reactions, or reactions to certain medicines or foods.','(terms occurring on more labels are shown first): gastroenteritis'),('http://sideeffects.embl.de/se/C0017168/','Gastrooesophageal reflux disease',': A disorder characterized by reflux of the gastric and/or duodenal contents into the distal esophagus. It is chronic in nature and usually caused by incompetence of the lower esophageal sphincter, and may result in injury to the esophageal mucosal. Symptoms include heartburn and acid indigestion.','(terms occurring on more labels are shown first): GERD, gastroesophageal reflux, gastroesophageal reflux disease, gastric reflux, gastrooesophageal reflux disease, gastro-oesophageal reflux disease, gastro-esophageal reflux disease, acid reflux, gastro-esophageal reflux, gastro-oesophageal reflux, gastro- oesophageal reflux disease, gastro oesophageal reflux disease, oesophageal reflux, GORD, gastro- oesophageal reflux, Esophageal reflux, Gastrooesophageal reflux, Gastroesophageal refluxdisease, gastro -esophageal reflux disease, Gastrooeso- phageal reflux, GastroesophagealReflux Disease, Gastroesophage al reflux, Gastro-oesophagea l reflux, Gastro-oesophage al reflux disease, Gastro-oesopha geal reflux disease, Gastro- esophageal reflux disease, gastro esophageal reflux d