embl.de/se/C0040485/','Torticollis',': A symptom, not a disease, of a twisted neck. In most instances, the head is tipped toward one side and the chin rotated toward the other. The involuntary muscle contractions in the neck region of patients with torticollis can be due to congenital defects, trauma, inflammation, tumors, and neurological or other factors.','(terms occurring on more labels are shown first): torticollis, retrocollis'),('http://sideeffects.embl.de/se/C0040822/','Tremor',': Cyclical movement of a body part that can represent either a physiologic process or a manifestation of disease. Intention or action tremor, a common manifestation of CEREBELLAR DISEASES, is aggravated by movement. In contrast, resting tremor is maximal when there is no attempt at voluntary movement, and occurs as a relatively frequent manifestation of PARKINSON DISEASE.','(terms occurring on more labels are shown first): tremor, tremors, tremo r, Shaking'),('http://sideeffects.embl.de/se/C0040997/','Trigeminal neuralgia',': A syndrome characterized by recurrent episodes of excruciating pain lasting several seconds or longer in the sensory distribution of the TRIGEMINAL NERVE. Pain may be initiated by stimulation of trigger points on the face, lips, or gums or by movement of facial muscles or chewing. Associated conditions include MULTIPLE SCLEROSIS, vascular anomalies, ANEURYSMS, and neoplasms. (Adams et al., Principles of Neurology, 6th ed, p187)','(terms occurring on more labels are shown first): trigeminal neuralgia, tic douloureux'),('http://sideeffects.embl.de/se/C0041582/','Ulcer',': The formation of a break on the skin or on the surface of an organ. An ulcer forms when the surface cells die and are cast off. Ulcers may be associated with cancer and other diseases.','(terms occurring on more labels are shown first): ulceration, ulcer, ulcers, ulcerative, ulcerations, ulcerated'),('http://sideeffects.embl.de/se/C0041834/','Erythema',': Redness of the skin produced by congestio